CREATE FUNCTION [dbo].[F_IsValidLogin]
(@PS_USR_ID varchar(100), @PS_USR_PSWD varchar(100))
RETURNS varchar(1)
WITH EXEC AS CALLER
AS
BEGIN
   DECLARE @VRETURN VARCHAR(1);
   
   set @VRETURN = 'N';
   IF EXISTS(
     SELECT USR_ID FROM AC01USR WHERE USR_ID = @PS_USR_ID AND USR_PSWD = @PS_USR_PSWD)
     set @VRETURN = 'Y'
   ELSE
     set @VRETURN = 'N';
   
   RETURN @VRETURN;
END;
GO
