CREATE VIEW [dbo].[VWMST01LOV_DEPT_INFO]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT,
RSEQNO, RUID, DTA_STS, BP_STS, LOV_SEQ1, LOV_SEQ2, LOV_ID, LOV_NM,
ISUSEDBY_RES, ISUSEDBY_AUDIT
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT,
A.RSEQNO, A.RUID, A.DTA_STS, A.BP_STS, A.LOV_SEQ1, A.LOV_SEQ2, A.LOV_ID, A.LOV_NM,
CASE WHEN B.DEPT_RUID IS NULL THEN 'N' ELSE 'Y' END AS ISUSEDBY_RES,
CASE WHEN C.DEPT_RUID IS NULL THEN 'N' ELSE 'Y' END AS ISUSEDBY_AUDIT
FROM MST01LOV_DEPT A
LEFT OUTER JOIN (SELECT DEPT_RUID FROM MST01RSRC GROUP BY DEPT_RUID) B ON A.RUID = B.DEPT_RUID
LEFT OUTER JOIN (SELECT DEPT_RUID FROM CPAR01LOV_AUDIT GROUP BY DEPT_RUID) C ON A.RUID = C.DEPT_RUID;
GO
