CREATE VIEW [dbo].[VWHRS01TRN_PADTLKPI_BASE]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT, RSEQNO, RUID, TRNPA_RUID, PACPT_RUID,
WGHT_VAL, WGHT_UOM_RUID, WGHT_UOM_ID, WGHT_UOM_NM, WGHT_UOM_SYM,
TRGT_VAL, TRGT_UOM_RUID, TRGT_UOM_ID, TRGT_UOM_NM, TRGT_UOM_SYM,
ACMT_VAL, ACMT_UOM_RUID, ACMT_UOM_ID, ACMT_UOM_NM, ACMT_UOM_SYM,
MGN_VAL, MGN_UOM_RUID, MGN_UOM_ID, MGN_UOM_NM, MGN_UOM_SYM,
SCORE_VAL, SCORE_UOM_RUID, SCORE_UOM_ID, SCORE_UOM_NM, SCORE_UOM_SYM,
SRBYWGHT_VAL, SRBYWGHT_UOM_RUID, SRBYWGHT_UOM_ID, SRBYWGHT_UOM_NM, SRBYWGHT_UOM_SYM,
RMK
) AS
SELECT 
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.TRNPA_RUID, A.PACPT_RUID,
A.WGHT_VAL, A.WGHT_UOM AS WGHT_UOM_RUID, C1.LOV_ID AS WGHT_UOM_ID, C1.LOV_NM AS WGHT_UOM_NM, C1.LOV_SYM AS WGHT_UOM_SYM,
A.TRGT_VAL, A.TRGT_UOM AS TRGT_UOM_RUID, C2.LOV_ID AS TRGT_UOM_ID, C2.LOV_NM AS TRGT_UOM_NM, C2.LOV_SYM AS TRGT_UOM_SYM,
A.ACMT_VAL, A.ACMT_UOM AS ACMT_UOM_RUID, C3.LOV_ID AS ACMT_UOM_ID, C3.LOV_NM AS ACMT_UOM_NM, C3.LOV_SYM AS ACMT_UOM_SYM,
A.MGN_VAL, A.MGN_UOM AS MGN_UOM_RUID, C4.LOV_ID AS MGN_UOM_ID, C4.LOV_NM AS MGN_UOM_NM, C4.LOV_SYM AS MGN_UOM_SYM,
A.SCORE_VAL, A.SCORE_UOM AS SCORE_UOM_RUID, C5.LOV_ID AS SCORE_UOM_ID, C5.LOV_NM AS SCORE_UOM_NM, C5.LOV_SYM AS SCORE_UOM_SYM,
A.SRBYWGHT_VAL, A.SRBYWGHT_UOM AS SRBYWGHT_UOM_RUID, C6.LOV_ID AS SRBYWGHT_UOM_ID, C1.LOV_NM AS SRBYWGHT_UOM_NM, C1.LOV_SYM AS SRBYWGHT_UOM_SYM,
A.RMK
FROM HRS01TRN_PAKPI A
LEFT OUTER JOIN MST01LOV_UOM C1 ON A.WGHT_UOM = C1.RUID
LEFT OUTER JOIN MST01LOV_UOM C2 ON A.TRGT_UOM = C2.RUID
LEFT OUTER JOIN MST01LOV_UOM C3 ON A.ACMT_UOM = C3.RUID
LEFT OUTER JOIN MST01LOV_UOM C4 ON A.MGN_UOM = C4.RUID
LEFT OUTER JOIN MST01LOV_UOM C5 ON A.SCORE_UOM = C5.RUID
LEFT OUTER JOIN MST01LOV_UOM C6 ON A.SRBYWGHT_UOM = C6.RUID;
GO
