RMK, NOTES, ADD_RMK1, ADD_RMK2, ADD_RMK3, ADD_RMK4, ADD_RMK5,
ADD_FLD1, ADD_FLD2, ADD_FLD3, ADD_FLD4, ADD_FLD5,
BIZ_ACT, RES_STS, RES_STS_STARTDT, RES_STS_ENDDT, IMG_SRC,
CURR_DT,
WORK_PERIOD,
WORK_PERIOD_MOD5,
LEAVECFG_RUID, LEAVECFG_1YEAR_MAXNUM, LEAVECFG_5YEAR_MAXNUM,
CB_RUID, CB_ID, CB_NM,
CBLEAVE_BAL, CBLEAVE_NUM,
CBNUM_START,
CBNUM_END,
CBDT_START,
CBDT_END,
CBEXPDT_IN1MTH,
CBEXPDT_IN3MTH,
CBEXPDT_IN6MTH,
CB5_DT,
CB10_DT,
CB15_DT,
CB20_DT,
CB25_DT,
CB30_DT,
CB35_DT,
CB40_DT,
CB45_DT,
CB50_DT
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.DTA_STS, A.BP_STS,
A.DEPT_RUID, A1.LOV_ID AS DEPT_ID, A1.LOV_NM AS DEPT_NM,
A.BRNCH_RUID, A2.LOV_ID AS BRNCH_ID, A2.LOV_NM AS BRNCH_NM,
A.CMPNY_RUID,
A.JOB_TITLE_RUID, A3.LOV_ID AS JOB_TITLE_ID, A3.LOV_NM AS JOB_TITLE_NM,
A.RELIGION_RUID,
A.RES_TYPE, A.RES_ID, A.RES_NM1, A.RES_NM2, A.RES_NM3,
A.RES_XID1, A.RES_XID2, A.RES_XID3, A.RES_XID4, A.RES_XID5,
A.RES_XNM1, A.RES_XNM2, A.RES_XNM3, A.RES_XNM4, A.RES_XNM5,
A.SEX, A.MRTL_STS, A.POB, A.DOB, A.JOIN_DT, A.NPWP, A.JAMSOSTEK_NO,
A.PHN_HMO1, A.PHN_HMO2, A.PHN_HMO3, A.PHN_HMO4, A.PHN_HMO5,
A.PHN_MBL1, A.PHN_MBL2, A.PHN_MBL3, A.PHN_MBL4, A.PHN_MBL5,
A.PHN_OFF1, A.PHN_OFF2, A.PHN_OFF3, A.PHN_OFF4, A.PHN_OFF5,
A.FAX1, A.FAX2, A.FAX3, A.FAX4, A.FAX5,
A.MAIL1, A.MAIL2, A.MAIL3, A.MAIL4, A.MAIL5,
A.WEBSITE1, A.WEBSITE2, A.WEBSITE3, A.WEBSITE4, A.WEBSITE5,
A.CP1_NM, A.CP1_PHN_HMO, A.CP1_PHN_MBL, A.CP1_MAIL, A.CP1_WEBSITE,
A.CP2_NM, A.CP2_PHN_HMO, A.CP2_PHN_MBL, A.CP2_MAIL, A.CP2_WEBSITE,
A.RMK, A.NOTES, A.ADD_RMK1, A.ADD_RMK2, A.ADD_RMK3, A.ADD_RMK4, A.ADD_RMK5,
A.ADD_FLD1, A.ADD_FLD2, A.ADD_FLD3, A.ADD_FLD4, A.ADD_FLD5,
A.BIZ_ACT, A.RES_STS, A.RES_STS_STARTDT, A.RES_STS_ENDDT, A.IMG_SRC,
CURRENT_TIMESTAMP AS CURR_DT,
DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) AS WORK_PERIOD,
DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) % 5 AS WORK_PERIOD_MOD5,
A5.RUID AS LEAVECFG_RUID, A5.LEAVE_1YEAR_MAXNUM AS LEAVECFG_1YEAR_MAXNUM, A5.LEAVE_5YEAR_MAXNUM AS LEAVECFG_5YEAR_MAXNUM,
A4.RUID AS CB_RUID, A4.LOV_ID AS CB_ID, A4.LOV_NM AS CB_NM,
A6.LEAVE_BAL AS CBLEAVE_BAL, A6.LEAVE_NUM AS CBLEAVE_NUM,
DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) - (DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) % 5) AS CBNUM_START,
DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) - (DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) % 5)+5 AS CBNUM_END,
DATEADD(month,(12)*(DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) - (DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) % 5)),A.JOIN_DT) AS CBDT_START,
DATEADD(month,(12)*(DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) - (DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) % 5)+5),A.JOIN_DT) AS CBDT_END,
DATEADD(month, -1, DATEADD(month,(12)*(DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) - (DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) % 5)+5),A.JOIN_DT)) AS CBEXPDT_IN1MTH,
DATEADD(month, -3, DATEADD(month,(12)*(DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) - (DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) % 5)+5),A.JOIN_DT)) AS CBEXPDT_IN3MTH,
DATEADD(month, -6, DATEADD(month,(12)*(DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) - (DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) % 5)+5),A.JOIN_DT)) AS CBEXPDT_IN6MTH,
DATEADD(month,(12)*5,A.JOIN_DT) AS CB5_DT,
DATEADD(month,(12)*10,A.JOIN_DT) AS CB10_DT,
DATEADD(month,(12)*15,A.JOIN_DT) AS CB15_DT,
DATEADD(month,(12)*20,A.JOIN_DT) AS CB20_DT,
DATEADD(month,(12)*25,A.JOIN_DT) AS CB25_DT,
DATEADD(month,(12)*30,A.JOIN_DT) AS CB30_DT,
DATEADD(month,(12)*35,A.JOIN_DT) AS CB35_DT,
DATEADD(month,(12)*40,A.JOIN_DT) AS CB40_DT,
DATEADD(month,(12)*45,A.JOIN_DT) AS CB45_DT,
DATEADD(month,(12)*50,A.JOIN_DT) AS CB50_DT
FROM MST01RSRC A
LEFT OUTER JOIN MST01LOV_DEPT A1 ON A.DEPT_RUID = A1.RUID
LEFT OUTER JOIN MST01LOV_BRNCH A2 ON A.BRNCH_RUID = A2.RUID
LEFT OUTER JOIN MST01LOV_JOBTTL A3 ON A.JOB_TITLE_RUID = A3.RUID
LEFT OUTER JOIN MSL01LOV_EMPHIST A4 ON DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) - (DATEDIFF(YEAR, A.JOIN_DT , CURRENT_TIMESTAMP) % 5) = A4.LOV_VAL
LEFT OUTER JOIN MSL01CFG_LEAVE A5 ON A.DEPT_RUID = A5.DEPT_RUID
LEFT OUTER JOIN MSL01TRN_LEAVEBAL A6 ON A.RUID = A6.RES_RUID AND A4.RUID = A6.LEAVE_RUID
WHERE A.RES_TYPE = 'EMP';
GO
