CREATE VIEW [dbo].[VWHRS01TRN_PADTLCPY_BASE]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT, RSEQNO, RUID, TRNPA_RUID, PACPT_RUID,
RQMT_VAL, RQMT_UOM_RUID, RQMT_UOM_ID, RQMT_UOM_NM, RQMT_UOM_SYM,
AGRCR_VAL, AGRCR_UOM_RUID, AGRCR_UOM_ID, AGRCR_UOM_NM, AGRCR_UOM_SYM,
SCORE_VAL, SCORE_UOM_RUID, SCORE_UOM_ID, SCORE_UOM_NM, SCORE_UOM_SYM,
CPYASM_VAL, CPYASM_UOM_RUID, CPYASM_UOM_ID, CPYASM_UOM_NM, CPYASM_UOM_SYM,
CPYEVL_VAL, CPYEVL_UOM_RUID, CPYEVL_UOM_ID, CPYEVL_UOM_NM, CPYEVL_UOM_SYM,
CPYAPV_VAL, CPYAPV_UOM_RUID, CPYAPV_UOM_ID, CPYAPV_UOM_NM, CPYAPV_UOM_SYM,
RMK
) AS
SELECT 
    A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.TRNPA_RUID, A.PACPT_RUID,
    A.RQMT_VAL, A.RQMT_UOM AS RQMT_UOM_RUID, C1.LOV_ID AS RQMT_UOM_ID, C1.LOV_NM AS RQMT_UOM_NM, C1.LOV_SYM AS RQMT_UOM_SYM,
    A.AGRCR_VAL, A.AGRCR_UOM AS AGRCR_UOM_RUID, C2.LOV_ID AS AGRCR_UOM_ID, C2.LOV_NM AS AGRCR_UOM_NM, C2.LOV_SYM AS AGRCR_UOM_SYM,
    A.SCORE_VAL, A.SCORE_UOM AS SCORE_UOM_RUID, C3.LOV_ID AS SCORE_UOM_ID, C3.LOV_NM AS SCORE_UOM_NM, C3.LOV_SYM AS SCORE_UOM_SYM,
    A.CPYASM_VAL, A.CPYASM_UOM AS CPYASM_UOM_RUID, C4.LOV_ID AS CPYASM_UOM_ID, C4.LOV_NM AS CPYASM_UOM_NM, C4.LOV_SYM AS CPYASM_UOM_SYM,
    A.CPYEVL_VAL, A.CPYEVL_UOM AS CPYEVL_UOM_RUID, C5.LOV_ID AS CPYEVL_UOM_ID, C5.LOV_NM AS CPYEVL_UOM_NM, C5.LOV_SYM AS CPYEVL_UOM_SYM,
    A.CPYAPV_VAL, A.CPYAPV_UOM AS CPYAPV_UOM_RUID, C6.LOV_ID AS CPYAPV_UOM_ID, C6.LOV_NM AS CPYAPV_UOM_NM, C6.LOV_SYM AS CPYAPV_UOM_SYM,
    A.RMK
FROM HRS01TRN_PACPY A
LEFT OUTER JOIN MST01LOV_UOM C1 ON A.RQMT_UOM = C1.RUID
LEFT OUTER JOIN MST01LOV_UOM C2 ON A.AGRCR_UOM = C2.RUID
LEFT OUTER JOIN MST01LOV_UOM C3 ON A.SCORE_UOM = C3.RUID
LEFT OUTER JOIN MST01LOV_UOM C4 ON A.CPYASM_UOM = C4.RUID
LEFT OUTER JOIN MST01LOV_UOM C5 ON A.CPYEVL_UOM = C5.RUID
LEFT OUTER JOIN MST01LOV_UOM C6 ON A.CPYAPV_UOM = C6.RUID;
GO
