CREATE VIEW [dbo].[VWAC01USR_MNU_CSTM01] (
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT, RSEQNO, RUID, DTA_STS, BP_STS,
USR_RUID, MDLE_RUID, MNU_RUID, IS_GRANTED,
MNU_RSEQNO, MNU_ID, MNU_CAPTION, MNU_LANG_ID, MNU_LINK_ID,
MNU_PARENT_RUID, MNU_LEVEL, MNU_STYLE, MNU_IMG, MNU_TYPE, MNU_ISVISIBLE
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.DTA_STS, A.BP_STS,
