B.RSEQNO AS MNU_RSEQNO, B.MNU_ID, B.MNU_CAPTION, B.MNU_LANG_ID, B.MNU_LINK_ID,
B.MNU_PARENT_RUID, B.MNU_LEVEL, B.MNU_STYLE, B.MNU_IMG, B.MNU_TYPE, B.MNU_ISVISIBLE
FROM AC01USR_MNU A
LEFT OUTER JOIN AC01MNU B ON A.MNU_RUID = B.RUID
