CREATE VIEW [dbo].[VWCPAR01LOV_STDREFF_INFO]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT,
RSEQNO, RUID, DTA_STS, LOV_SEQ1, LOV_SEQ2, LOV_ID, LOV_NM, LOV_VAL, LOV_SYM,
ISUSEDBY_CPAR
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT,
A.RSEQNO, A.RUID, A.DTA_STS, A.LOV_SEQ1, A.LOV_SEQ2, A.LOV_ID, A.LOV_NM, A.LOV_VAL, A.LOV_SYM,
CASE WHEN B.STDREF_RUID IS NULL THEN 'N' ELSE 'Y' END AS ISUSEDBY_CPAR
FROM CPAR01LOV_STDREFF A
LEFT OUTER JOIN (SELECT STDREF_RUID FROM CPAR01CPAR_STDREF
                 WHERE STDREF_RUID IS NOT NULL AND CPAR_RUID IS NOT NULL
                 GROUP BY STDREF_RUID) B ON A.RUID = B.STDREF_RUID;
GO
