CREATE VIEW [dbo].[VWCPAR01LOV_AUDIT_INFO]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT,
RSEQNO, RUID, DTA_STS, LOV_SEQ1, LOV_SEQ2, LOV_ID, LOV_NM, LOV_VAL, LOV_SYM,
DEPT_RUID, DEPT_ID, DEPT_NM,
ISUSEDBY_CPAR
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT,
A.RSEQNO, A.RUID, A.DTA_STS, A.LOV_SEQ1, A.LOV_SEQ2, A.LOV_ID, A.LOV_NM, A.LOV_VAL, A.LOV_SYM,
A.DEPT_RUID, B1.LOV_ID AS DEPT_ID, B1.LOV_NM AS DEPT_NM,
CASE WHEN C.AUDIT_RUID IS NULL THEN 'N' ELSE 'Y' END AS ISUSEDBY_CPAR
FROM CPAR01LOV_AUDIT A
LEFT OUTER JOIN MST01LOV_DEPT B1 ON A.DEPT_RUID = B1.RUID
LEFT OUTER JOIN (SELECT AUDIT_RUID FROM CPAR01CPAR WHERE AUDIT_RUID IS NOT NULL GROUP BY AUDIT_RUID) C ON A.RUID = C.AUDIT_RUID
GO
