CREATE VIEW [dbo].[VWASM01TRN_STOCKIN_CSTM01]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT, RSEQNO, RUID, DTA_STS, BP_STS,
PROD_CTGRY, PROD_SUBCTGRY, PROD_TYP, PROD_SUBTYP1, PROD_SUBTYP2, PROD_SUBTYP3, PROD_SUBTYP4, PROD_SUBTYP5,
PROD_ITMNO, PBLSHR_RUID, BIZ_PNR_RUID, PO_NO, WO_NO, TRN_DT, TRN_NO,
TRN_QTY, TRN_PRICE, TRN_AMNT,
ADD_NOTE, RMK1, RMK2, RMK3, RMK4, RMK5, ADD_FLD1, ADD_FLD2, ADD_FLD3, ADD_FLD4, ADD_FLD5,
DOC_REFF_NO, ASST_TAG_ID, ASST_STS_RUID, ASST_ACT_RUID, DEPT_RUID, RSRC_USER_RUID, RSRC_CTR_PRTY_RUID,
PBLSHR_NM, PROD_SUBCTGRY_NM, PROD_TYP_NM, PROD_INFO,
ADTRL_WKS_OUT, ADTRL_IP_OUT,
ADTRL_USR_OUT, ADTRL_PRG_OUT, ADTRL_DT_OUT,
ADD_NOTE_OUT, ASST_STS_RUID_DEFIDLE,
RSRC_USER_NM
) AS
select A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.DTA_STS, A.BP_STS,
       A.PROD_CTGRY, A.PROD_SUBCTGRY, A.PROD_TYP, A.PROD_SUBTYP1, A.PROD_SUBTYP2, A.PROD_SUBTYP3, A.PROD_SUBTYP4, A.PROD_SUBTYP5,
       A.PROD_ITMNO, A.PBLSHR_RUID, A.BIZ_PNR_RUID, A.PO_NO, A.WO_NO, A.TRN_DT, A.TRN_NO,
       A.TRN_QTY, A.TRN_PRICE, A.TRN_AMNT,
       A.ADD_NOTE, A.RMK1, A.RMK2, A.RMK3, A.RMK4, A.RMK5, A.ADD_FLD1, A.ADD_FLD2, A.ADD_FLD3, A.ADD_FLD4, A.ADD_FLD5,
       B.ASST_TAG_ID, B.DOC_REFF_NO, B.ASST_STS_RUID, B.ASST_ACT_RUID, B.DEPT_RUID, B.RSRC_USER_RUID, B.RSRC_CTR_PRTY_RUID,
       C.LOV_NM AS PBLSHR_NM, D.LOV_NM AS PROD_SUBCTGRY_NM, E.LOV_NM AS PROD_TYP_NM,
       isnull(D.LOV_NM,'')+' - '+isnull(E.LOV_NM,'')+' - '+isnull(C.LOV_NM,'') AS PROD_INFO,
       B.ADTRL_WKS AS ADTRL_WKS_OUT, B.ADTRL_IP AS ADTRL_IP_OUT,
    B.ADTRL_USR AS ADTRL_USR_OUT, B.ADTRL_PRG AS ADTRL_PRG_OUT, B.ADTRL_DT AS ADTRL_DT_OUT,
    B.ADD_NOTE AS ADD_NOTE_OUT, ISNULL(B.ASST_STS_RUID,'LOV_ASST_STS_IDLE') AS ASST_STS_RUID_DEFIDLE,
		ISNULL(B1.RES_NM1,'')+' '+ISNULL(B1.RES_NM2,'')+' '+ISNULL(B1.RES_NM3,'') AS RSRC_USER_NM
from ASM01TRN_STOCKIN A
     LEFT OUTER JOIN ASM01TRN_STOCKOUT B ON A.RUID = B.STOCKIN_RUID
     LEFT OUTER JOIN ASM01LOV_PBLSHR C ON A.PBLSHR_RUID = C.RUID
     LEFT OUTER JOIN ASM01LOV_CMPNT_GRP_SUBCTGRY D ON A.PROD_SUBCTGRY = D.RUID
   LEFT OUTER JOIN ASM01LOV_CMPNT_GRP_TYP E ON A.PROD_TYP = E.RUID
	 LEFT OUTER JOIN MST01RSRC B1 ON ISNULL(B.RSRC_USER_RUID,'') = B1.RUID;
GO
