CREATE VIEW [dbo].[VWASM01TRN_STOCKOUT_INFO]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT,
RSEQNO, RUID, DTA_STS, BP_STS,
STOCKIN_RUID,
PROD_CTGRY, PROD_CTGRY_ID, PROD_CTGRY_NM,
PROD_SUBCTGRY, PROD_SUBCTGRY_ID, PROD_SUBCTGRY_NM,
PROD_TYP, PROD_TYP_ID, PROD_TYP_NM,
PBLSHR_RUID, BIZ_PNR_RUID,
PROD_ITMNO, PROD_NM,
VERSION, SUBSCRIPTION_SN, SUBSCRIPTION_VER,
REQUEST_CODE, PRODUCT_ID, ACTIVATION_CODE,
LICENSE_START_DT, LICENSE_END_DT,
ADTRL_USR_UPD, ADTRL_DT_UPD,
STOCKOUT02_RUID, ASST_TAG_ID, ASST_STS_RUID, ASST_ACT_RUID,
DEPT_RUID, DEPT_ID, DEPT_NM,
RSRC_USER_RUID, RSRC_USER_NM,
RSRC_CTR_PRTY_RUID,
TRN_DT, DOC_REFF_NO, ADD_NOTE,
RMK1, RMK2, RMK3, RMK4, RMK5,
ADD_FLD1, ADD_FLD2, ADD_FLD3, ADD_FLD4, ADD_FLD5 
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT,
A.RSEQNO, A.RUID, A.DTA_STS, A.BP_STS,
A.STOCKIN_RUID,
B3.PROD_CTGRY, C1.LOV_ID AS PROD_CTGRY_ID, C1.LOV_NM AS PROD_CTGRY_NM,
B3.PROD_SUBCTGRY, C2.LOV_ID AS PROD_SUBCTGRY_ID, C2.LOV_NM AS PROD_SUBCTGRY_NM,
B3.PROD_TYP, C3.LOV_ID AS PROD_TYP_ID, C3.LOV_NM AS PROD_TYP_NM,
B3.PBLSHR_RUID, B3.BIZ_PNR_RUID,
B3.PROD_ITMNO, B3.ADD_FLD1 AS PROD_NM,
B4.VERSION, B4.SUBSCRIPTION_SN, B4.SUBSCRIPTION_VER,
B4.REQUEST_CODE, B4.PRODUCT_ID, B4.ACTIVATION_CODE,
B4.LICENSE_START_DT, B4.LICENSE_END_DT,
B4.ADTRL_USR_UPD, B4.ADTRL_DT_UPD,
A.STOCKOUT02_RUID, A.ASST_TAG_ID, A.ASST_STS_RUID, A.ASST_ACT_RUID,
A.DEPT_RUID, B1.LOV_ID AS DEPT_ID, B1.LOV_NM AS DEPT_NM,
A.RSRC_USER_RUID, ISNULL(RES_NM1,'')+ISNULL(RES_NM2,'')+ISNULL(RES_NM3,'') AS RSRC_USER_NM,
A.RSRC_CTR_PRTY_RUID,
A.TRN_DT, A.DOC_REFF_NO, A.ADD_NOTE,
A.RMK1, A.RMK2, A.RMK3, A.RMK4, A.RMK5,
A.ADD_FLD1, A.ADD_FLD2, A.ADD_FLD3, A.ADD_FLD4, A.ADD_FLD5 
FROM ASM01TRN_STOCKOUT A
LEFT OUTER JOIN MST01LOV_DEPT B1 ON A.DEPT_RUID = B1.RUID
LEFT OUTER JOIN MST01RSRC B2 ON A.RSRC_USER_RUID = B2.RUID
LEFT OUTER JOIN ASM01TRN_STOCKIN B3 ON A.STOCKIN_RUID = B3.RUID
LEFT OUTER JOIN ASM01TRN_STOCKIN_SW B4 ON B3.RUID = B4.TRIN_RUID
LEFT OUTER JOIN ASM01LOV_CMPNT_GRP_CTGRY C1 ON B3.PROD_CTGRY = C1.RUID
LEFT OUTER JOIN ASM01LOV_CMPNT_GRP_SUBCTGRY C2 ON B3.PROD_SUBCTGRY = C2.RUID
LEFT OUTER JOIN ASM01LOV_CMPNT_GRP_TYP C3 ON B3.PROD_TYP = C3.RUID
GO
