CREATE VIEW [dbo].[VWASM02TRN_STOCKOUT_INFO]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT, RSEQNO, RUID, DTA_STS, BP_STS,
STOCKIN_RUID,
PROD_CTGRY, PROD_CTGRY_ID, PROD_CTGRY_NM,
PROD_SUBCTGRY, PROD_SUBCTGRY_ID, PROD_SUBCTGRY_NM,
PROD_TYP, PROD_TYP_ID, PROD_TYP_NM,
PROD_ITMNO,
PROD_NM,
PO_NO, WO_NO, TRN_QTY, TRN_PRICE, TRN_AMNT,
STOCKOUT02_RUID,
ASST_TAG_ID, ASST_STS_RUID, ASST_ACT_RUID,
DEPT_RUID, DEPT_ID, DEPT_NM,
RSRC_USER_RUID, RSRC_USER_NM,
RSRC_CTR_PRTY_RUID, TRN_DT, DOC_REFF_NO, ADD_NOTE,
RMK1, RMK2, RMK3, RMK4, RMK5,
ADD_FLD1, ADD_FLD2, ADD_FLD3, ADD_FLD4, ADD_FLD5 
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.DTA_STS, A.BP_STS,
A.STOCKIN_RUID,
C1.PROD_CTGRY, D1.LOV_ID AS PROD_CTGRY_ID, D1.LOV_NM AS PROD_CTGRY_NM,
C1.PROD_SUBCTGRY, D2.LOV_ID AS PROD_SUBCTGRY_ID, D2.LOV_NM AS PROD_SUBCTGRY_NM,
C1.PROD_TYP, D3.LOV_ID AS PROD_TYP_ID, D3.LOV_NM AS PROD_TYP_NM,
C1.PROD_ITMNO,
C1.ADD_FLD1 AS PROD_NM,
C1.PO_NO, C1.WO_NO, C1.TRN_QTY, C1.TRN_PRICE, C1.TRN_AMNT,
A.STOCKOUT02_RUID,
A.ASST_TAG_ID, A.ASST_STS_RUID, A.ASST_ACT_RUID,
A.DEPT_RUID, B1.LOV_ID AS DEPT_ID, B1.LOV_NM AS DEPT_NM,
A.RSRC_USER_RUID, ISNULL(B2.RES_NM1,'')+ISNULL(B2.RES_NM2,'')+ISNULL(B2.RES_NM3,'') AS RSRC_USER_NM,
A.RSRC_CTR_PRTY_RUID, A.TRN_DT, A.DOC_REFF_NO, A.ADD_NOTE,
A.RMK1, A.RMK2, A.RMK3, A.RMK4, A.RMK5,
A.ADD_FLD1, A.ADD_FLD2, A.ADD_FLD3, A.ADD_FLD4, A.ADD_FLD5 
FROM ASM02TRN_STOCKOUT A
LEFT OUTER JOIN MST01LOV_DEPT B1 ON A.DEPT_RUID = B1.RUID
LEFT OUTER JOIN MST01RSRC B2 ON A.RSRC_USER_RUID = B2.RUID
LEFT OUTER JOIN ASM01TRN_STOCKIN C1 ON A.STOCKIN_RUID = C1.RUID
LEFT OUTER JOIN ASM01LOV_CMPNT_GRP_CTGRY D1 ON C1.PROD_CTGRY = D1.RUID
LEFT OUTER JOIN ASM01LOV_CMPNT_GRP_SUBCTGRY D2 ON C1.PROD_SUBCTGRY = D2.RUID
LEFT OUTER JOIN ASM01LOV_CMPNT_GRP_TYP D3 ON C1.PROD_TYP = D3.RUID
GO
