CREATE VIEW [dbo].[VWASM02TRN_STOCKOUT_CSTM01]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT, RSEQNO, RUID, DTA_STS, BP_STS,
STOCKIN_RUID, STOCKOUT02_RUID, ASST_TAG_ID, ASST_STS_RUID, ASST_ACT_RUID, DEPT_RUID, RSRC_USER_RUID,
RSRC_CTR_PRTY_RUID, TRN_DT, DOC_REFF_NO,
ADD_NOTE, RMK1, RMK2, RMK3, RMK4, RMK5, ADD_FLD1, ADD_FLD2, ADD_FLD3, ADD_FLD4, ADD_FLD5,
PROD_CTGRY, PROD_SUBCTGRY, PROD_TYP, PBLSHR_RUID,
PO_NO, WO_NO, TRN_QTY, TRN_PRICE, TRN_AMNT, PROD_ITMNO, BIZ_PNR_RUID,
PBLSHR_NM, PROD_SUBCTGRY_NM, PROD_TYP_NM,
PROD_INFO
) AS
select A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.DTA_STS, A.BP_STS,
       A.STOCKIN_RUID, A.STOCKOUT02_RUID, A.ASST_TAG_ID, A.ASST_STS_RUID, A.ASST_ACT_RUID, A.DEPT_RUID, A.RSRC_USER_RUID,
			 A.RSRC_CTR_PRTY_RUID, A.TRN_DT, A.DOC_REFF_NO,
			 A.ADD_NOTE, A.RMK1, A.RMK2, A.RMK3, A.RMK4, A.RMK5, A.ADD_FLD1, A.ADD_FLD2, A.ADD_FLD3, A.ADD_FLD4, A.ADD_FLD5,
			 B.PROD_CTGRY, B.PROD_SUBCTGRY, B.PROD_TYP, B.PBLSHR_RUID,
			 B.PO_NO, B.WO_NO, B.TRN_QTY, B.TRN_PRICE, B.TRN_AMNT, B.PROD_ITMNO, B.BIZ_PNR_RUID,
       C.LOV_NM AS PBLSHR_NM, D.LOV_NM AS PROD_SUBCTGRY_NM, E.LOV_NM AS PROD_TYP_NM,
       D.LOV_NM+' - '+E.LOV_NM+' - '+C.LOV_NM AS PROD_INFO
from ASM02TRN_STOCKOUT A
		 LEFT OUTER JOIN ASM01TRN_STOCKIN B ON A.STOCKIN_RUID = B.RUID
		 LEFT OUTER JOIN ASM01LOV_PBLSHR C ON B.PBLSHR_RUID = C.RUID
     LEFT OUTER JOIN ASM01LOV_CMPNT_GRP_SUBCTGRY D ON B.PROD_SUBCTGRY = D.RUID
   LEFT OUTER JOIN ASM01LOV_CMPNT_GRP_TYP E ON B.PROD_TYP = E.RUID;
GO
