A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.DTA_STS, A.BP_STS,
A.PROD_CTGRY, B1.LOV_ID AS PROD_CTGRY_ID, B1.LOV_NM AS PROD_CTGRY_NM,
A.PROD_SUBCTGRY, B2.LOV_ID AS PROD_SUBCTGRY_ID, B2.LOV_NM AS PROD_SUBCTGRY_NM,
A.PROD_TYP, B3.LOV_ID AS PROD_TYP_ID, B3.LOV_NM AS PROD_TYP_NM,
A.PROD_SUBTYP1, A.PROD_SUBTYP2, A.PROD_SUBTYP3, A.PROD_SUBTYP4, A.PROD_SUBTYP5,
A.PROD_ITMNO,
A.PBLSHR_RUID, B4.LOV_ID AS PBLSHR_ID, B4.LOV_NM AS PBLSHR_NM,
A.BIZ_PNR_RUID,
A.PO_NO, A.WO_NO, A.TRN_DT, A.TRN_NO,
A.TRN_QTY, A.TRN_PRICE, A.TRN_AMNT,
