BIZUNIT_RUID, BIZUNIT_ID, BIZUNIT_NM, BIZUNIT_SEQ1,
DEPT_RUID, DEPT_ID, DEPT_NM, DEPT_SEQ1,
PROD_CTGRY, PROD_CTGRY_ID, PROD_CTGRY_NM, PROD_CTGRY_SEQ1,
PROD_SUBCTGRY, PROD_SUBCTGRY_ID, PROD_SUBCTGRY_NM, PROD_SUBCTGRY_SEQ1,
