PROD_NM, PROD_NO, PROD_QUOT_NO, PROD_DO_NO, PROD_CUST_NAME,
ADD_NOTE, RMK1, RMK2, RMK3, RMK4, RMK5,
PJX_STS, PJX_STS_ID, PJX_STS_NM, PJX_STS_SEQ1,
PJX_TRGT_START, PJX_TRGT_END, PJX_ACTL_START, PJX_ACTL_END
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.DTA_STS,
A.BIZUNIT_RUID, A1.LOV_ID AS BIZUNIT_ID, A1.LOV_NM AS BIZUNIT_NM, A1.LOV_SEQ1 AS BIZUNIT_SEQ1,
A.DEPT_RUID, A5.LOV_ID AS DEPT_ID, A5.LOV_NM AS DEPT_NM, A5.LOV_SEQ1 AS DEPT_SEQ1,
A.PROD_CTGRY, A2.LOV_ID AS PROD_CTGRY_ID, A2.LOV_NM AS PROD_CTGRY_NM, A2.LOV_SEQ1 AS PROD_CTGRY_SEQ1,
A.PROD_SUBCTGRY, A3.LOV_ID AS PROD_SUBCTGRY_ID, A3.LOV_NM AS PROD_SUBCTGRY_NM, A3.LOV_SEQ1 AS PROD_SUBCTGRY_SEQ1,
