A.PJX_STS, A4.LOV_ID AS PJX_STS_ID, A4.LOV_NM AS PJX_STS_NM, A4.LOV_SEQ1 AS PJX_STS_SEQ1,
A.PJX_TRGT_START, A.PJX_TRGT_END, A.PJX_ACTL_START, A.PJX_ACTL_END
