RES_XNM1, RES_XNM2, RES_XNM3, RES_XNM4, RES_XNM5,
SEX, MRTL_STS, POB, DOB, JOIN_DT, NPWP, JAMSOSTEK_NO,
PHN_HMO1, PHN_HMO2, PHN_HMO3, PHN_HMO4, PHN_HMO5,
PHN_MBL1, PHN_MBL2, PHN_MBL3, PHN_MBL4, PHN_MBL5,
PHN_OFF1, PHN_OFF2, PHN_OFF3, PHN_OFF4, PHN_OFF5,
FAX1, FAX2, FAX3, FAX4, FAX5,
MAIL1, MAIL2, MAIL3, MAIL4, MAIL5,
WEBSITE1, WEBSITE2, WEBSITE3, WEBSITE4, WEBSITE5,
CP1_NM, CP1_PHN_HMO, CP1_PHN_MBL, CP1_MAIL, CP1_WEBSITE,
CP2_NM, CP2_PHN_HMO, CP2_PHN_MBL, CP2_MAIL, CP2_WEBSITE,
RMK, NOTES, ADD_RMK1, ADD_RMK2, ADD_RMK3, ADD_RMK4, ADD_RMK5,
ADD_FLD1, ADD_FLD2, ADD_FLD3, ADD_FLD4, ADD_FLD5,
BIZ_ACT, RES_STS, RES_STS_STARTDT, RES_STS_ENDDT, IMG_SRC 
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.DTA_STS, A.BP_STS,
A4.BIZUNIT_RUID, B.LOV_ID AS BIZUNIT_ID, B.LOV_NM AS BIZUNIT_NM,
A.DEPT_RUID, A1.LOV_ID AS DEPT_ID, A1.LOV_NM AS DEPT_NM,
A.BRNCH_RUID, A2.LOV_ID AS BRNCH_ID, A2.LOV_NM AS BRNCH_NM,
A.CMPNY_RUID,
A.JOB_TITLE_RUID, A3.LOV_ID AS JOB_TITLE_ID, A3.LOV_NM AS JOB_TITLE_NM,
A.RELIGION_RUID,
A.RES_TYPE, A.RES_ID, A.RES_NM1, A.RES_NM2, A.RES_NM3,
A.RES_XID1, A.RES_XID2, A.RES_XID3, A.RES_XID4, A.RES_XID5,
A.RES_XNM1, A.RES_XNM2, A.RES_XNM3, A.RES_XNM4, A.RES_XNM5,
A.SEX, A.MRTL_STS, A.POB, A.DOB, A.JOIN_DT, A.NPWP, A.JAMSOSTEK_NO,
A.PHN_HMO1, A.PHN_HMO2, A.PHN_HMO3, A.PHN_HMO4, A.PHN_HMO5,
A.PHN_MBL1, A.PHN_MBL2, A.PHN_MBL3, A.PHN_MBL4, A.PHN_MBL5,
A.PHN_OFF1, A.PHN_OFF2, A.PHN_OFF3, A.PHN_OFF4, A.PHN_OFF5,
A.FAX1, A.FAX2, A.FAX3, A.FAX4, A.FAX5,
A.MAIL1, A.MAIL2, A.MAIL3, A.MAIL4, A.MAIL5,
A.WEBSITE1, A.WEBSITE2, A.WEBSITE3, A.WEBSITE4, A.WEBSITE5,
A.CP1_NM, A.CP1_PHN_HMO, A.CP1_PHN_MBL, A.CP1_MAIL, A.CP1_WEBSITE,
A.CP2_NM, A.CP2_PHN_HMO, A.CP2_PHN_MBL, A.CP2_MAIL, A.CP2_WEBSITE,
A.RMK, A.NOTES, A.ADD_RMK1, A.ADD_RMK2, A.ADD_RMK3, A.ADD_RMK4, A.ADD_RMK5,
A.ADD_FLD1, A.ADD_FLD2, A.ADD_FLD3, A.ADD_FLD4, A.ADD_FLD5,
A.BIZ_ACT, A.RES_STS, A.RES_STS_STARTDT, A.RES_STS_ENDDT, A.IMG_SRC 
FROM MST01RSRC A
LEFT OUTER JOIN MST01LOV_DEPT A1 ON A.DEPT_RUID = A1.RUID
LEFT OUTER JOIN MST01LOV_BRNCH A2 ON A.BRNCH_RUID = A2.RUID
LEFT OUTER JOIN MST01LOV_JOBTTL A3 ON A.JOB_TITLE_RUID = A3.RUID
LEFT OUTER JOIN HDESK01MAP_BIZUNIT_DEPT A4 ON A.DEPT_RUID = A4.DEPT_RUID
LEFT OUTER JOIN HDESK01LOV_BIZUNIT B ON A4.BIZUNIT_RUID = B.RUID
GO
/****** Object:  View [dbo].[VWCPAR01YEARALL_INFO]    Script Date: 11/03/2015 15:23:35 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[VWCPAR01YEARALL_INFO]
(
RSEQNO
,RUID
,CPAR_YEARS, AUDITEE_RUID
,CPAR_IA
,CPAR_TM
,CPAR_PP
,CPAR_PI
,CPAR_CC
,CPAR_LL
) AS
SELECT
CAST(RAND() * 1000000 AS INT) AS RSEQNO
,CAST(NEWID() AS VARCHAR(100)) AS RUID
,A.CPAR_YEARS, A.AUDITEE_RUID
,SUM(A.CPAR_IA) AS CPAR_IA
,SUM(A.CPAR_TM) AS CPAR_TM
,SUM(A.CPAR_PP) AS CPAR_PP
,SUM(A.CPAR_PI) AS CPAR_PI
,SUM(A.CPAR_CC) AS CPAR_CC
,SUM(A.CPAR_LL) AS CPAR_LL
FROM (
	SELECT
	year(CPAR_DT) as CPAR_YEARS, AUDITEE_RUID
	,case when CPAR_TYPE = 'IA' then 1 else 0 end as CPAR_IA
	,case when CPAR_TYPE = 'TM' then 1 else 0 end as CPAR_TM
	,case when CPAR_TYPE = 'PP' then 1 else 0 end as CPAR_PP
	,case when CPAR_TYPE = 'PI' then 1 else 0 end as CPAR_PI
	,case when CPAR_TYPE = 'CC' then 1 else 0 end as CPAR_CC
	,case when CPAR_TYPE = 'LL' then 1 else 0 end as CPAR_LL
	FROM CPAR01CPAR) A
GROUP BY A.CPAR_YEARS, A.AUDITEE_RUID;
GO
