RSEQNO, RUID, DTA_STS, PROJ_ID, PROJ_NM,
PROJ_STS, PROJ_STS_ID, PROJ_STS_NM, CLIENT_RUID,
ISUSEDBY_COMPLAIN
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT,
A.RSEQNO, A.RUID, A.DTA_STS, A.PROJ_ID, A.PROJ_NM,
A.PROJ_STS, B.LOV_ID AS PROJ_STS_ID, B.LOV_NM AS PROJ_STS_NM, A.CLIENT_RUID,
CASE WHEN C.PROJ_RUID IS NULL THEN 'N' ELSE 'Y' END AS ISUSEDBY_COMPLAIN
FROM CPAR01PROJ A
LEFT OUTER JOIN CPAR01LOV_PROJSTS B ON A.PROJ_STS = B.RUID
LEFT OUTER JOIN (SELECT PROJ_RUID FROM CPAR01COMPLAIN GROUP BY PROJ_RUID) C ON A.RUID = C.PROJ_RUID;
GO
