CREATE VIEW [dbo].[VWHRS01LOV_PACPT_SCLE_INFO]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT,
RSEQNO, RUID, DTA_STS, ACT_YEAR,
LOV_ID, LOV_NM, LOV_VAL, LOV_TYPE, LOV_SUBTYPE, LOV_VAL1, LOV_VAL2,
UOM, UOM_ID, UOM_NM, UOM_SEQ1, UOM_SYM,
VAL_TYPE,
RNGOPR_RUID, RNGOPR_ID, RNGOPR_NM, RNGOPR_SYM1, RNGOPR_SYM2,
LOV_SEQ1 
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT,
A.RSEQNO, A.RUID, A.DTA_STS, A.ACT_YEAR,
A.LOV_ID, A.LOV_NM, A.LOV_VAL, A.LOV_TYPE, A.LOV_SUBTYPE, A.LOV_VAL1, A.LOV_VAL2,
A.UOM, B1.LOV_ID AS UOM_ID, B1.LOV_NM AS UOM_NM, B1.LOV_SEQ1 AS UOM_SEQ1, B1.LOV_SYM AS UOM_SYM,
A.VAL_TYPE,
A.RNGOPR_RUID, B2.LOV_ID AS RNGOPR_ID, B2.LOV_NM AS RNGOPR_NM, B2.LOV_SYM1 AS RNGOPR_SYM1, B2.LOV_SYM2 AS RNGOPR_SYM2,
A.LOV_SEQ1 
FROM HRS01LOV_PACPT_SCLE A
LEFT OUTER JOIN MST01LOV_UOM B1 ON A.UOM = B1.RUID
LEFT OUTER JOIN MST01LOV_RNGOPR B2 ON A.RNGOPR_RUID = B2.RUID;
GO
