CREATE VIEW [dbo].[VWHRS01REL_CLCBSE_PACPTVSJOBTTL_BASE]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT, RSEQNO, RUID, DTA_STS, ACT_YEAR,
PACPT_RUID, PACPT_ID, PACPT_NM, PACPT_TYPE, PACPT_SUBTYPE, PACPT_RSEQNO, PACPT_LVL,
PACPT_PARENT_RUID, PACPT_PARENT_ID, PACPT_PARENT_NM, PACPT_PARENT_TYPE, PACPT_PARENT_SUBTYPE, PACPT_PARENT_RSEQNO, PACPT_PARENT_LVL,
PACPT_ROOT_RUID, PACPT_ROOT_ID, PACPT_ROOT_NM, PACPT_ROOT_TYPE, PACPT_ROOT_SUBTYPE, PACPT_ROOT_RSEQNO, PACPT_ROOT_LVL,
PAJOBTTL_RUID, LOV_VAL, UOM, UOM_ID, UOM_NM, UOM_SYM,
PRIOTYP, PRIOTYP_ID, PRIOTYP_NM
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.DTA_STS, A.ACT_YEAR,
A.PACPT_RUID, B1.LOV_ID AS PACPT_ID, B1.LOV_NM AS PACPT_NM, B1.LOV_TYPE AS PACPT_TYPE, B1.LOV_SUBTYPE AS PACPT_SUBTYPE, B1.RSEQNO AS PACPT_RSEQNO, B1.LOV_LVL AS PACPT_LVL,
B1.LOV_PARENT_RUID AS PACPT_PARENT_RUID, B2.LOV_ID AS PACPT_PARENT_ID, B2.LOV_NM AS PACPT_PARENT_NM, B2.LOV_TYPE AS PACPT_PARENT_TYPE, B2.LOV_SUBTYPE AS PACPT_PARENT_SUBTYPE, B2.RSEQNO AS PACPT_PARENT_RSEQNO, B2.LOV_LVL AS PACPT_PARENT_LVL,
B2.LOV_PARENT_RUID AS PACPT_ROOT_RUID, B3.LOV_ID AS PACPT_ROOT_ID, B3.LOV_NM AS PACPT_ROOT_NM, B3.LOV_TYPE AS PACPT_ROOT_TYPE, B3.LOV_SUBTYPE AS PACPT_ROOT_SUBTYPE, B3.RSEQNO AS PACPT_ROOT_RSEQNO, B3.LOV_LVL AS PACPT_ROOT_LVL,
A.PAJOBTTL_RUID, A.LOV_VAL, A.UOM, C1.LOV_ID AS UOM_ID, C1.LOV_NM AS UOM_NM, C1.LOV_SYM AS UOM_SYM,
A.PRIOTYP, D1.LOV_ID AS PRIOTYP_ID, D1.LOV_NM AS PRIOTYP_NM
FROM VWHRS01REL_CLCBSE_PACPTVSJOBTTL_BYACTYR A
LEFT OUTER JOIN VWHRS01LOV_PACPT_BYACTYR B1 ON A.PACPT_RUID = B1.RUID
LEFT OUTER JOIN VWHRS01LOV_PACPT_BYACTYR B2 ON B1.LOV_PARENT_RUID = B2.RUID
LEFT OUTER JOIN VWHRS01LOV_PACPT_BYACTYR B3 ON B2.LOV_PARENT_RUID = B3.RUID
LEFT OUTER JOIN MST01LOV_UOM C1 ON A.UOM = C1.RUID
LEFT OUTER JOIN HRS01LOV_PRIO_TYPE D1 ON A.PRIOTYP = D1.RUID;
GO
