CREATE VIEW [dbo].[VWCPAR01COMPLAIN_INFO]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT,
RSEQNO, RUID, DTA_STS,
COMPLAIN_STS, COMPLAIN_STS_ID, COMPLAIN_STS_NM,
COMPLAIN_ID, COMPLAIN_NM,
COMPLAIN_TYPE, COMPLAIN_TYPE_ID, COMPLAIN_TYPE_NM,
COMPLAIN_SUBTYPE,
DESCRIPTION, SOLUTION, ISSUED_DT, RESPONSE_DT, TARGET_DT,
RECIPIENT_RUID, RECIPIENT_NM,
RECIPIENT_DEPTRUID, RECIPIENT_DEPTID, RECIPIENT_DEPTNM,
PIC_RUID, PIC_NM,
PIC_DEPTRUID, PIC_DEPTID, PIC_DEPTNM,
PROJ_RUID, PROJ_ID, PROJ_NM,
PROJ_STS, PROJ_STS_ID, PROJ_STS_NM, CLIENT_RUID,
IS_CPAR
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT,
A.RSEQNO, A.RUID, A.DTA_STS,
A.COMPLAIN_STS, C1.LOV_ID AS COMPLAIN_STS_ID, C1.LOV_NM AS COMPLAIN_STS_NM,
A.COMPLAIN_ID, A.COMPLAIN_NM,
A.COMPLAIN_TYPE, C2.LOV_ID AS COMPLAIN_TYPE_ID, C2.LOV_NM AS COMPLAIN_TYPE_NM,
A.COMPLAIN_SUBTYPE,
A.DESCRIPTION, A.SOLUTION, A.ISSUED_DT, A.RESPONSE_DT, A.TARGET_DT,
A.RECIPIENT_RUID, B1.RES_NM1 AS RECIPIENT_NM,
B1.DEPT_RUID AS RECIPIENT_DEPTRUID, B1.DEPT_ID AS RECIPIENT_DEPTID, B1.DEPT_NM AS RECIPIENT_DEPTNM,
A.PIC_RUID, B2.RES_NM1 AS PIC_NM,
B2.DEPT_RUID AS PIC_DEPTRUID, B2.DEPT_ID AS PIC_DEPTID, B2.DEPT_NM AS PIC_DEPTNM,
A.PROJ_RUID, B3.PROJ_ID, B3.PROJ_NM,
B3.PROJ_STS, B3.PROJ_STS_ID, B3.PROJ_STS_NM, B3.CLIENT_RUID,
A.IS_CPAR
FROM CPAR01COMPLAIN A
LEFT OUTER JOIN VWMST01EMPLOYEE_INFO B1 ON A.RECIPIENT_RUID = B1.RUID
LEFT OUTER JOIN VWMST01EMPLOYEE_INFO B2 ON A.PIC_RUID = B2.RUID
LEFT OUTER JOIN VWCPAR01PROJ_INFO B3 ON A.PROJ_RUID = B3.RUID
LEFT OUTER JOIN CPAR01LOV_COMPLAINSTS C1 ON A.COMPLAIN_STS = C1.RUID
LEFT OUTER JOIN CPAR01LOV_COMPLAINTYPE C2 ON A.COMPLAIN_TYPE = C2.RUID;
GO
