(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT, RSEQNO, RUID, DTA_STS, BP_STS,
STOCKIN_RUID, STOCKOUT02_RUID,
ASST_TAG_ID, ASST_STS_RUID, ASST_ACT_RUID,
DEPT_RUID,
RSRC_USER_RUID,
RSRC_CTR_PRTY_RUID, TRN_DT, DOC_REFF_NO, ADD_NOTE,
RMK1, RMK2, RMK3, RMK4, RMK5,
ADD_FLD1, ADD_FLD2, ADD_FLD3, ADD_FLD4, ADD_FLD5,
PROD_ITMNO,
PROD_CTGRY, PROD_CTGRY_ID, PROD_CTGRY_NM,
PROD_SUBCTGRY, PROD_SUBCTGRY_ID, PROD_SUBCTGRY_NM,
PROD_TYP, PROD_TYP_ID, PROD_TYP_NM,
PBLSHR_RUID, PBLSHR_ID, PBLSHR_NM,
BIZ_PNR_RUID,
TRN_QTY_IN,
TRN_QTY_OUT,
TRN_PRICE, TRN_AMNT
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.DTA_STS, A.BP_STS,
A.STOCKIN_RUID, A.STOCKOUT02_RUID,
A.ASST_TAG_ID, A.ASST_STS_RUID, A.ASST_ACT_RUID,
A.DEPT_RUID,
A.RSRC_USER_RUID,
A.RSRC_CTR_PRTY_RUID, A.TRN_DT, A.DOC_REFF_NO, A.ADD_NOTE,
A.RMK1, A.RMK2, A.RMK3, A.RMK4, A.RMK5,
A.ADD_FLD1, A.ADD_FLD2, A.ADD_FLD3, A.ADD_FLD4, A.ADD_FLD5,
B.PROD_ITMNO,
B.PROD_CTGRY, B.PROD_CTGRY_ID, B.PROD_CTGRY_NM,
B.PROD_SUBCTGRY, B.PROD_SUBCTGRY_ID, B.PROD_SUBCTGRY_NM,
B.PROD_TYP, B.PROD_TYP_ID, B.PROD_TYP_NM,
B.PBLSHR_RUID, B.PBLSHR_ID, B.PBLSHR_NM,
B.BIZ_PNR_RUID,
B.TRN_QTY AS TRN_QTY_IN,
CASE WHEN ISNULL(A.ASST_STS_RUID, 'LOV_ASST_STS_IDLE') = 'LOV_ASST_STS_IDLE' THEN 0 ELSE 1 END AS TRN_QTY_OUT,
B.TRN_PRICE, B.TRN_AMNT
FROM ASM01TRN_STOCKOUT A, VWASMTRN_STOCKIN_PARTS_INFO B
WHERE A.STOCKIN_RUID = B.RUID
