CREATE VIEW [dbo].[VWMST01RSRC_HRS_CSTM_EMP]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT, RSEQNO, RUID, DTA_STS, ACT_YEAR, 
RES_RUID, RES_NM,
RES_NM1, RES_NM2, RES_NM3,
JOBTTL_RUID, JOBTTL_NM,
JOBTTLGRP_RUID, JOBTTLGRP_NM,
JOBTTLSUBGRP_RUID, JOBTTLSUBGRP_NM,
MSTCMPNY_RUID, MSTBRNCH_RUID, MSTBRNCH_NM,
MSTDEPT_RUID, MSTDEPT_NM, MSTJOBTTL_RUID, MSTJOBTTL_NM,
MSTRES_RUID, MSTRES_ID, MSTRES_XID1,
COEFFCLS_RUID, COEFFCLS_ID, COEFFCLS_NM,
JTLCLS_RUID, JTLCLS_ID, JTLCLS_NM,
PRVLG_IS_NEED_PA,
PRVLG_CPYEVL_RES_RUID, PRVLG_CPYEVL_RES_NM,
PRVLG_CPYAPV_RES_RUID, PRVLG_CPYAPV_RES_NM,
PRVLG_KPIEVL_RES_RUID, PRVLG_KPIEVL_RES_NM
) AS
SELECT
B.ADTRL_WKS, B.ADTRL_IP, B.ADTRL_USR, B.ADTRL_PRG, B.ADTRL_DT, B.RSEQNO, B.RUID, B.DTA_STS, B.ACT_YEAR, 
B.RES_RUID, isnull(A.RES_NM1,'')+isnull(A.RES_NM2,'')+isnull(A.RES_NM3,'') as RES_NM,
A.RES_NM1, A.RES_NM2, A.RES_NM3,
B.JOBTTL_RUID, F.LOV_NM AS JOBTTL_NM,
C.JOBTTLGRP_RUID, D.LOV_NM AS JOBTTLGRP_NM,
C.JOBTTLSUBGRP_RUID, E.LOV_NM AS JOBTTLSUBGRP_NM,
A.CMPNY_RUID AS MSTCMPNY_RUID, A.BRNCH_RUID AS MSTBRNCH_RUID, J3.LOV_NM AS MSTBRNCH_NM,
A.DEPT_RUID AS MSTDEPT_RUID, J1.LOV_NM AS MSTDEPT_NM, A.JOB_TITLE_RUID AS MSTJOBTTL_RUID, J2.LOV_NM AS MSTJOBTTL_NM,
A.RUID AS MSTRES_RUID, A.RES_ID AS MSTRES_ID, A.RES_XID1 AS MSTRES_XID1,
F.COEFFCLS_RUID, G.LOV_ID AS COEFFCLS_ID, G.LOV_NM AS COEFFCLS_NM,
F.JTLCLS_RUID, H.LOV_ID AS JTLCLS_ID, H.LOV_NM AS JTLCLS_NM,
I.IS_NEED_PA AS PRVLG_IS_NEED_PA,
I.CPYEVL_RES_RUID AS PRVLG_CPYEVL_RES_RUID, isnull(I1.RES_NM1,'')+isnull(I1.RES_NM2,'')+isnull(I1.RES_NM3,'') AS PRVLG_CPYEVL_RES_NM,
I.CPYAPV_RES_RUID AS PRVLG_CPYAPV_RES_RUID, isnull(I2.RES_NM1,'')+isnull(I2.RES_NM2,'')+isnull(I2.RES_NM3,'') AS PRVLG_CPYAPV_RES_NM,
I.KPIEVL_RES_RUID AS PRVLG_KPIEVL_RES_RUID, isnull(I3.RES_NM1,'')+isnull(I3.RES_NM2,'')+isnull(I3.RES_NM3,'') AS PRVLG_KPIEVL_RES_NM
from MST01RSRC A
LEFT OUTER JOIN VWHRS01REL_JOBTTL_RESEMP_BYACTYR B ON A.RUID = B.RES_RUID
LEFT OUTER JOIN VWHRS01REL_JOBTTL_GRPSUBGRP_BYACTYR C ON B.JOBTTL_RUID = C.JOBTTL_RUID
LEFT OUTER JOIN VWHRS01LOV_JOBTTL_GRP_BYACTYR D ON C.JOBTTLGRP_RUID = D.RUID
LEFT OUTER JOIN VWHRS01LOV_JOBTTL_SUBGRP_BYACTYR E ON C.JOBTTLSUBGRP_RUID = E.RUID
LEFT OUTER JOIN VWHRS01LOV_JOBTTL_BYACTYR F ON C.JOBTTL_RUID = F.RUID
LEFT OUTER JOIN VWHRS01LOV_COEFFCLS_BYACTYR G ON F.COEFFCLS_RUID = G.RUID
LEFT OUTER JOIN VWHRS01LOV_JOBTTL_CLASS_BYACTYR H ON F.JTLCLS_RUID = H.RUID
LEFT OUTER JOIN VWHRS01PRVLG_PA_AUTHTOEMP_BYACTYR I ON A.RUID = I.RES_RUID
LEFT OUTER JOIN MST01RSRC I1 ON I.CPYEVL_RES_RUID = I1.RUID
LEFT OUTER JOIN MST01RSRC I2 ON I.CPYAPV_RES_RUID = I2.RUID
LEFT OUTER JOIN MST01RSRC I3 ON I.KPIEVL_RES_RUID = I3.RUID
LEFT OUTER JOIN MST01LOV_DEPT J1 ON A.DEPT_RUID = J1.RUID
LEFT OUTER JOIN MST01LOV_JOBTTL J2 ON A.JOB_TITLE_RUID = J2.RUID
LEFT OUTER JOIN MST01LOV_BRNCH J3 ON A.BRNCH_RUID = J3.RUID
where A.RES_TYPE = 'EMP';
GO
