RMK, NOTES, ADD_RMK1, ADD_RMK2, ADD_RMK3, ADD_RMK4, ADD_RMK5,
ADD_FLD1, ADD_FLD2, ADD_FLD3, ADD_FLD4, ADD_FLD5,
BIZ_ACT, RES_STS, RES_STS_STARTDT, RES_STS_ENDDT, IMG_SRC,
CURR_DT,
WORK_PERIOD,
WORK_PERIOD_MOD5,
LEAVECFG_RUID, LEAVECFG_1YEAR_MAXNUM, LEAVECFG_5YEAR_MAXNUM,
CB_RUID, CB_ID, CB_NM,
CBLEAVE_BAL, CBLEAVE_NUM,
CBNUM_START,
CBNUM_END,
CBDT_START,
CBDT_END,
CBEXPDT_IN1MTH,
CBEXPDT_IN3MTH,
CBEXPDT_IN6MTH,
CB5_DT,
CB10_DT,
CB15_DT,
CB20_DT,
CB25_DT,
CB30_DT,
CB35_DT,
CB40_DT,
CB45_DT,
CB50_DT
) AS
SELECT
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT, RSEQNO, RUID, DTA_STS, BP_STS,
DEPT_RUID, DEPT_ID, DEPT_NM,
BRNCH_RUID, BRNCH_ID, BRNCH_NM,
CMPNY_RUID,
JOB_TITLE_RUID, JOB_TITLE_ID, JOB_TITLE_NM,
RELIGION_RUID,
RES_TYPE, RES_ID, RES_NM1, RES_NM2, RES_NM3,
RES_XID1, RES_XID2, RES_XID3, RES_XID4, RES_XID5,
RES_XNM1, RES_XNM2, RES_XNM3, RES_XNM4, RES_XNM5,
SEX, MRTL_STS, POB, DOB, JOIN_DT, NPWP, JAMSOSTEK_NO,
PHN_HMO1, PHN_HMO2, PHN_HMO3, PHN_HMO4, PHN_HMO5,
PHN_MBL1, PHN_MBL2, PHN_MBL3, PHN_MBL4, PHN_MBL5,
PHN_OFF1, PHN_OFF2, PHN_OFF3, PHN_OFF4, PHN_OFF5,
FAX1, FAX2, FAX3, FAX4, FAX5,
MAIL1, MAIL2, MAIL3, MAIL4, MAIL5,
WEBSITE1, WEBSITE2, WEBSITE3, WEBSITE4, WEBSITE5,
CP1_NM, CP1_PHN_HMO, CP1_PHN_MBL, CP1_MAIL, CP1_WEBSITE,
CP2_NM, CP2_PHN_HMO, CP2_PHN_MBL, CP2_MAIL, CP2_WEBSITE,
RMK, NOTES, ADD_RMK1, ADD_RMK2, ADD_RMK3, ADD_RMK4, ADD_RMK5,
ADD_FLD1, ADD_FLD2, ADD_FLD3, ADD_FLD4, ADD_FLD5,
BIZ_ACT, RES_STS, RES_STS_STARTDT, RES_STS_ENDDT, IMG_SRC,
CURR_DT,
CASE WHEN cast(CBDT_START As Date) > cast(CURRENT_TIMESTAMP As Date)
   THEN WORK_PERIOD-1
   ELSE WORK_PERIOD
END as WORK_PERIOD,
WORK_PERIOD_MOD5,
LEAVECFG_RUID, LEAVECFG_1YEAR_MAXNUM, LEAVECFG_5YEAR_MAXNUM,
CB_RUID, CB_ID, CB_NM,
CBLEAVE_BAL, CBLEAVE_NUM,
CASE WHEN cast(CBDT_START As Date) > cast(CURRENT_TIMESTAMP As Date)
   THEN CBNUM_START - 5
   ELSE CBNUM_START
END as CBNUM_START,
CASE WHEN cast(CBDT_START As Date) > cast(CURRENT_TIMESTAMP As Date)
   THEN CBNUM_END - 5
   ELSE CBNUM_END
END as CBNUM_END,
CASE WHEN cast(CBDT_START As Date) > cast(CURRENT_TIMESTAMP As Date)
   THEN DATEADD(month, 12*(CBNUM_START - 5), JOIN_DT) 
   ELSE DATEADD(month, 12*CBNUM_START, JOIN_DT) 
END as CBDT_START,
CASE WHEN cast(CBDT_START As Date) > cast(CURRENT_TIMESTAMP As Date)
   THEN DATEADD(month, 12*(CBNUM_END - 5), JOIN_DT) 
   ELSE DATEADD(month, 12*CBNUM_END, JOIN_DT) 
END as CBDT_END,
CASE WHEN cast(CBDT_START As Date) > cast(CURRENT_TIMESTAMP As Date)
   THEN DATEADD(year, -5, CBEXPDT_IN1MTH) 
   ELSE CBEXPDT_IN1MTH
END as CBEXPDT_IN1MTH,
CASE WHEN cast(CBDT_START As Date) > cast(CURRENT_TIMESTAMP As Date)
   THEN DATEADD(year, -5, CBEXPDT_IN3MTH) 
   ELSE CBEXPDT_IN3MTH
END as CBEXPDT_IN3MTH,
CASE WHEN cast(CBDT_START As Date) > cast(CURRENT_TIMESTAMP As Date)
   THEN DATEADD(year, -5, CBEXPDT_IN6MTH) 
   ELSE CBEXPDT_IN6MTH
END as CBEXPDT_IN6MTH,
CB5_DT,
CB10_DT,
CB15_DT,
CB20_DT,
CB25_DT,
CB30_DT,
CB35_DT,
CB40_DT,
CB45_DT,
CB50_DT
FROM VWMSL01EMPLOYEE_CB
GO
