CREATE VIEW [dbo].[VWCPAR01CPAR_INFO]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT,
RSEQNO, RUID, DTA_STS,
CPAR_STS, CPAR_STS_ID, CPAR_STS_NM,
CPAR_STEP, CPAR_STEP_ID, CPAR_STEP_NM,
CPAR_ID, CPAR_DT, CPAR_TRGT_DT, CPAR_FINISH_DT,
CPAR_DESC, CPAR_RESOLUTION1, CPAR_RESOLUTION2, CPAR_RESOLUTION3,
CPAR_TYPE, CPAR_TYPE_ID, CPAR_TYPE_NM,
CPAR_SUBTYPE, CPAR_SUBTYPE_ID, CPAR_SUBTYPE_NM,
AUDITOR_RUID, AUDITOR_ID, AUDITOR_NM, AUDITOR_USRRUID,
AUDITORDEPT_RUID, AUDITORDEPT_ID, AUDITORDEPT_NM,
AUDITEE_RUID, AUDITEE_ID, AUDITEE_NM, AUDITEE_USRRUID,
AUDITEEDEPT_RUID, AUDITEEDEPT_ID, AUDITEEDEPT_NM,
AUDIT_RUID, AUDIT_ID, AUDIT_NM,
AUDITDEPT_RUID, AUDITDEPT_ID, AUDITDEPT_NM,
CLASS_RUID, CLASS_ID, CLASS_NM,
VFKS1_DT, VFKS1_DESC, VFKS2_DT, VFKS2_DESC, VFKS3_DT, VFKS3_DESC,
VFKS4_DT, VFKS4_DESC, VFKS5_DT, VFKS5_DESC,
COMPLAIN_RUID, COMPLAIN_ID, COMPLAIN_NM, COMPLAIN_CLIENTRUID, OWNER_NM
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT,
A.RSEQNO, A.RUID, A.DTA_STS,
A.CPAR_STS, B1.LOV_ID AS CPAR_STS_ID, B1.LOV_NM AS CPAR_STS_NM,
A.CPAR_STEP, B4.LOV_ID AS CPAR_STEP_ID, B4.LOV_NM AS CPAR_STEP_NM,
A.CPAR_ID, A.CPAR_DT, A.CPAR_TRGT_DT, A.CPAR_FINISH_DT,
A.CPAR_DESC, A.CPAR_RESOLUTION1, A.CPAR_RESOLUTION2, A.CPAR_RESOLUTION3,
A.CPAR_TYPE, B2.LOV_ID AS CPAR_TYPE_ID, B2.LOV_NM AS CPAR_TYPE_NM,
A.CPAR_SUBTYPE, B3.LOV_ID AS CPAR_SUBTYPE_ID, B3.LOV_NM AS CPAR_SUBTYPE_NM,
A.AUDITOR_RUID, C1.RES_ID AS AUDITOR_ID, C1.RES_NM1 AS AUDITOR_NM, C1.RUID AS AUDITOR_USRRUID,
A.AUDITORDEPT_RUID, C1.DEPT_ID AS AUDITORDEPT_ID, C1.DEPT_NM AS AUDITORDEPT_NM,
A.AUDITEE_RUID, C2.RES_ID AS AUDITEE_ID, C2.RES_NM1 AS AUDITEE_NM, C2.RUID AS AUDITEE_USRRUID,
A.AUDITEEDEPT_RUID, C2.DEPT_ID AS AUDITEEDEPT_ID, C2.DEPT_NM AS AUDITEEDEPT_NM,
A.AUDIT_RUID, D1.LOV_ID AS AUDIT_ID, D1.LOV_NM AS AUDIT_NM,
D1.DEPT_RUID AS AUDITDEPT_RUID, D1.DEPT_ID AS AUDITDEPT_ID, D1.DEPT_NM AS AUDITDEPT_NM,
A.CLASS_RUID, D2.LOV_ID AS CLASS_ID, D2.LOV_NM AS CLASS_NM,
A.VFKS1_DT, A.VFKS1_DESC, A.VFKS2_DT, A.VFKS2_DESC, A.VFKS3_DT, A.VFKS3_DESC,
A.VFKS4_DT, A.VFKS4_DESC, A.VFKS5_DT, A.VFKS5_DESC,
A.COMPLAIN_RUID, E1.COMPLAIN_ID, E1.COMPLAIN_NM, E1.CLIENT_RUID AS COMPLAIN_CLIENTRUID,
A.OWNER_NM
FROM CPAR01CPAR A
LEFT OUTER JOIN CPAR01LOV_CPARSTS B1 ON A.CPAR_STS = B1.RUID
LEFT OUTER JOIN CPAR01LOV_CPARTYPE B2 ON A.CPAR_TYPE = B2.RUID
LEFT OUTER JOIN CPAR01LOV_CPARSUBTYPE B3 ON A.CPAR_SUBTYPE = B3.RUID
LEFT OUTER JOIN CPAR01LOV_STEP B4 ON A.CPAR_STEP = B4.RUID
LEFT OUTER JOIN VWAC01USR_INFO C1 ON A.AUDITOR_RUID = C1.RES_RUID
LEFT OUTER JOIN VWAC01USR_INFO C2 ON A.AUDITEE_RUID = C2.RES_RUID
LEFT OUTER JOIN VWCPAR01LOV_AUDIT_INFO D1 ON A.AUDIT_RUID = D1.RUID
LEFT OUTER JOIN CPAR01LOV_CLASS D2 ON A.CLASS_RUID = D2.RUID
LEFT OUTER JOIN VWCPAR01COMPLAIN_INFO E1 ON A.COMPLAIN_RUID = E1.RUID;
GO
