CREATE VIEW [dbo].[VWDASBOARD_SWPBLSHR_INFO]
(
PBLSHR_RUID, PBLSHR_NM, PROD_STOCK_IN, PROD_STOCK_OUT
) AS
SELECT top 5 A.PBLSHR_RUID, A.PBLSHR_NM, ISNULL(A.PROD_STOCK_IN,0) AS PROD_STOCK_IN, ISNULL(B.PROD_STOCK_OUT,0) AS PROD_STOCK_OUT
FROM
(
 SELECT
 MAIN_PBLSHR_RUID AS PBLSHR_RUID, MAIN_PBLSHR_NM AS PBLSHR_NM, SUM(ISNULL(MAIN_TRN_QTY,1)) AS PROD_STOCK_IN
 FROM VWASM01TRN_STOCKIN_SW_INFO
 where MAIN_PBLSHR_NM is not null
 GROUP BY MAIN_PBLSHR_RUID, MAIN_PBLSHR_NM
) A
LEFT OUTER JOIN (
SELECT
PBLSHR_RUID, PBLSHR_NM, COUNT(PROD_NM) AS PROD_STOCK_OUT
FROM VWASM01TRN_STOCKOUTSW_INFO
where PBLSHR_NM is not null
GROUP BY PBLSHR_RUID, PBLSHR_NM
) B ON A.PBLSHR_NM = B.PBLSHR_NM
GO
