CREATE VIEW [dbo].[VWDASBOARD_PARTSSTOCK_INFO]
(
PROD_SUBCTGRY, PROD_SUBCTGRY_NM,
STOCK_IN, STOCK_OUT, STOCK_BAL,
STOCK_OUTPCT,
STOCK_BALPCT
) AS
SELECT A.PROD_SUBCTGRY, A.PROD_SUBCTGRY_NM,
       A.STOCK_IN, A.STOCK_OUT, A.STOCK_BAL,
    round(A.STOCK_OUT*100/A.STOCK_IN,2) AS STOCK_OUTPCT,
    round(A.STOCK_BAL*100/A.STOCK_IN,2) AS STOCK_BALPCT
FROM (
 SELECT PROD_SUBCTGRY, PROD_SUBCTGRY_NM,
    SUM(ISNULL(TRN_QTY_IN,0)) AS STOCK_IN,
    SUM(ISNULL(TRN_QTY_OUT,0)) AS STOCK_OUT,
    (SUM(ISNULL(TRN_QTY_IN,0)))-(SUM(ISNULL(TRN_QTY_OUT,0))) AS STOCK_BAL
 FROM VWASMTRN_STOCKOUT_PARTS_INFO
 GROUP BY PROD_SUBCTGRY, PROD_SUBCTGRY_NM
) A
GO
