B4.JOBTTLSUBGRP_RUID AS KPIEVLJOBTTLSUBGRP_RUID, B4.JOBTTLSUBGRP_ID AS KPIEVLJOBTTLSUBGRP_ID, B4.JOBTTLSUBGRP_NM AS KPIEVLJOBTTLSUBGRP_NM,
B4.COEFFCLS_RUID AS KPIEVLCOEFFCLS_RUID, B4.COEFFCLS_ID AS KPIEVLCOEFFCLS_ID, B4.COEFFCLS_NM AS KPIEVLCOEFFCLS_NM,
B4.JTLCLS_RUID AS KPIEVLJTLCLS_RUID, B4.JTLCLS_ID AS KPIEVLJTLCLS_ID, B4.JTLCLS_NM AS KPIEVLJTLCLS_NM,
