A.KPI_SR, A.KPI_WGHT, A.KPI_SRBYWGHT,
A.CPY_SR, A.CPY_WGHT, A.CPY_SRBYWGHT,
A.FINAL_SR,
A.FINAL_SR_RUID,
A3.LOV_ID AS FINAL_ID, A3.LOV_NM AS FINAL_NM, A3.LOV_VAL AS FINAL_VAL, A3.LOV_TYPE AS FINAL_TYPE, A3.LOV_SUBTYPE AS FINAL_SUBTYPE,
A3.LOV_VAL1 AS FINAL_LOVVAL1, A3.LOV_VAL2 AS FINAL_LOVVAL2,
A3.UOM AS FINALUOM_RUID, A3.UOM_ID AS FINALUOM_ID, A3.UOM_NM AS FINALUOM_NM, A3.UOM_SEQ1 AS FINALUOM_SEQ1, A3.UOM_SYM AS FINALUOM_SYM,
