A3.RNGOPR_RUID AS FINALOPR_RUID, A3.RNGOPR_ID AS FINALOPR_ID, A3.RNGOPR_NM AS FINALOPR_NM, A3.RNGOPR_SYM1 AS FINALOPR_SYM1, A3.RNGOPR_SYM2 AS FINALOPR_SYM2,
A3.LOV_SEQ1 AS FINALLOV_SEQ1,
