/****** Object:  View [dbo].[VWCPAR01NOTIF_CPAR_INFO]    Script Date: 11/03/2015 15:23:36 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[VWCPAR01NOTIF_CPAR_INFO]
(
RSEQNO,
RUID,
CPAR_STS,
AUDITOR_RUID, AUDITEE_RUID, AUDITEEDEPT_RUID,
PRECREATE, CREATED,
RESPONDED, VERIFIED
) AS
SELECT ROW_NUMBER() OVER(ORDER BY ISNULL(A.CPAR_STS,'')+ISNULL(AUDITOR_RUID,'')+ISNULL(AUDITEE_RUID,'')+ISNULL(AUDITEEDEPT_RUID,'')) AS RSEQNO,
			 ISNULL(A.CPAR_STS,'')+ISNULL(AUDITOR_RUID,'')+ISNULL(AUDITEE_RUID,'')+ISNULL(AUDITEEDEPT_RUID,'') AS RUID,
			 A.CPAR_STS,
			 A.AUDITOR_RUID, A.AUDITEE_RUID, A.AUDITEEDEPT_RUID,
			 SUM(A.PRECREATE) AS PRECREATE, SUM(A.CREATED) AS CREATED,
       SUM(A.RESPONDED) AS RESPONDED, SUM(A.VERIFIED) AS VERIFIED
FROM (
	SELECT
	CPAR_STS,
	AUDITOR_RUID, AUDITEE_RUID, AUDITEEDEPT_RUID,
	CASE WHEN ISNULL(CPAR_STEP,'CREATED') = 'PRECREATE' THEN 1 ELSE 0 END AS PRECREATE,
	CASE WHEN ISNULL(CPAR_STEP,'CREATED') = 'CREATED' THEN 1 ELSE 0 END AS CREATED,
	CASE WHEN ISNULL(CPAR_STEP,'CREATED') = 'RESPONDED' THEN 1 ELSE 0 END AS RESPONDED,
	CASE WHEN ISNULL(CPAR_STEP,'CREATED') = 'VERIFIED' THEN 1 ELSE 0 END AS VERIFIED
	FROM VWCPAR01CPAR_INFO ) A
GROUP BY 	A.CPAR_STS, A.AUDITOR_RUID, A.AUDITEE_RUID, A.AUDITEEDEPT_RUID;
GO
