CREATE VIEW [dbo].[VWHRS01TRN_PA_SUMSR_INFO]
(
FINAL_SR_RUID, FINAL_SR_NM,
FINAL_COUNT
) AS
select FINAL_SR_RUID, FINAL_SR_NM,
       SUM(FINAL_COUNT) AS FINAL_COUNT
FROM (
select MSTDEPT_RUID, MSTDEPT_NM,
       FINAL_SR_RUID, FINAL_SR_NM,
			 1 AS FINAL_COUNT
from VWHRS01TRN_PA_INFO
) DATA
GROUP BY FINAL_SR_RUID, FINAL_SR_NM
GO
/****** Object:  View [dbo].[VWHRS01TRN_PA_SUMDEPT_INFO]    Script Date: 11/03/2015 15:23:36 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
