) AS
SELECT
1 AS RSEQNO, 'RUID_1' AS RUID,
ISNULL(A1.FINAL_SR_RUID, 'Undefine') AS FINAL_SR_RUID, isnull(A1.FINAL_NM, 'Undefine') AS FINAL_SR_NM,
COUNT(A.RUID) AS FINAL_SR_NUM
FROM VWHRS01EMPLOYEE_INFO A
LEFT OUTER JOIN VWHRS01TRN_PA_TRXINFO A1 ON A.RUID = A1.RES_RUID
GROUP BY FINAL_SR_RUID, FINAL_NM
GO
