CREATE VIEW [dbo].[VWMSL01EMPLOYEECBREM_DASHBOARD_INFO]
(
RSEQNO, RUID,
EXPIN_1MONTH, EXPIN_3MONTH, EXPIN_6MONTH
) AS
SELECT
1 AS RSEQNO, 'RUID_1' AS RUID,
SUM(A.EXPIN_1MONTH) AS EXPIN_1MONTH, SUM(A.EXPIN_3MONTH) AS EXPIN_3MONTH, SUM(A.EXPIN_6MONTH) AS EXPIN_6MONTH
FROM (
select A.RUID, A.RES_NM1,
CASE WHEN B1.RUID IS NULL THEN 0 ELSE 1 END AS EXPIN_1MONTH,
CASE WHEN B2.RUID IS NULL THEN 0 ELSE 1 END AS EXPIN_3MONTH,
CASE WHEN B3.RUID IS NULL THEN 0 ELSE 1 END AS EXPIN_6MONTH
from VWMSL01EMPLOYEE_CB_INFO A
LEFT OUTER JOIN VWMSL01EMPLOYEE_CBREM1_INFO B1 ON A.RUID = B1.RUID
LEFT OUTER JOIN VWMSL01EMPLOYEE_CBREM3_INFO B2 ON A.RUID = B2.RUID
LEFT OUTER JOIN VWMSL01EMPLOYEE_CBREM6_INFO B3 ON A.RUID = B3.RUID
) A
GO
