/****** Object:  View [dbo].[VWHRS01DASH_PASCORE_WRAP1]    Script Date: 11/03/2015 15:23:36 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[VWHRS01DASH_PASCORE_WRAP1]
(
RSEQNO, RUID,
FINAL_SR_RUID, FINAL_SR_NM,
FINAL_SR_NUM,
EMPLOYEE_NUM
) AS
SELECT A.RSEQNO, A.RUID, A.RUID AS FINAL_SR_RUID, A.LOV_NM AS FINAL_SR_NM,
       ISNULL(A1.FINAL_SR_NUM,0) AS FINAL_SR_NUM,
			 (SELECT count(ruid) as EMPLOYEE_NUM FROM VWHRS01EMPLOYEE_INFO) AS EMPLOYEE_NUM
FROM VWHRS01LOV_PACPT_SCLE_CFGINFO A
LEFT OUTER JOIN VWHRS01DASH_PASCORE A1 ON A.RUID = A1.FINAL_SR_RUID
WHERE lov_type = 'SCORE' AND LOV_SUBTYPE = 'FNL'
UNION ALL
SELECT 99 as RSEQNO, RUID, FINAL_SR_RUID, FINAL_SR_NM,
       FINAL_SR_NUM,
			 (SELECT count(ruid) as EMPLOYEE_NUM FROM VWHRS01EMPLOYEE_INFO) AS EMPLOYEE_NUM
FROM VWHRS01DASH_PASCORE
WHERE FINAL_SR_RUID = 'Undefine'
GO
